import React, { useRef, useState, useEffect } from "react";
import { Redirect } from 'react-router';
import {
    MDBBtn,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBCardText,
    MDBCol,
    MDBContainer,
    MDBFormInline,
    MDBIcon,
    MDBInput,
    MDBRow,
    MDBTable,
    MDBTableBody,
    MDBTableHead
} from "mdbreact";
import {useHistory} from "react-router";
import logo from '../../assets/images/logo-white-large.png';

export const Dashboard = (props: any) =>{
    console.log(props)
    const history = useHistory();
      if (props.User === undefined) {
        return <Redirect to={{
            pathname: '/login',
        }} />
      } 
      if (props.User !== undefined && props.User.isOnboarded === false ) {
          return <Redirect to={{
            pathname: '/onboarding',
        }} />
      }
    return (
        <>
           <MDBContainer fluid>
                <MDBRow>
                    <MDBCol md='2'>
                        <MDBRow style={{backgroundColor: "#29283a", height: "7vh"}}>
                            <div>
                                <img
                                src={logo}
                                className="img"
                                alt=""
                                style={{ height: "4%"}}
                            />
                            </div>
                        </MDBRow>


                        <MDBRow style={{backgroundColor: "#3c3a4f", height: "93vh", justifyContent: "center"}}>
                            <br />
                             <p>
                                <MDBIcon fab onClick={() => window.open('https://www.facebook.com/apnisec.in')} icon="facebook-f" style={{ fontSize: "20px", color: "#fbfbfd", cursor: "pointer" }} />
                                <MDBIcon fab onClick={() => window.open('https://twitter.com/apnisec')} icon="twitter" style={{ fontSize: "20px", color: "#fbfbfd", cursor: "pointer" }} />
                                <MDBIcon fab onClick={() => window.open('https://www.linkedin.com/company/apnisec')} icon="linkedin-in" style={{ fontSize: "20px", color: "#fbfbfd", cursor: "pointer" }} />
                            </p>

                        </MDBRow>
                    </MDBCol>
                    <MDBCol md='6'>
                        <MDBRow style={{backgroundColor: "white", height: "7vh", width: "90vw", borderBottom: "1px soild #ededef"}}>
                            header
                        </MDBRow>
                        <MDBRow style={{backgroundColor: "#fbfbfd", height: "93vh", width: "90vw"}}>
                            dashboard
                        </MDBRow>
                    </MDBCol>
                </MDBRow>
           </MDBContainer>
        </>
    )
}
